import React from "react";
import { Link } from "react-router-dom";
import "./dashboard.css";

const Dashboard = ({ Username }) => {
    return (
        <div className="Body">
            <div className="Header">
                <h1>Welcome, {Username}</h1>
                <div className="Menu">
                    <Link to="/emp">   
                        <button className="">
                            Employee List
                        </button>
                    </Link>
                    <Link to="/l">
                        <button className="logout">
                            Logout
                        </button>
                    </Link>
                </div>
            </div>
        </div>
    );
}

export default Dashboard;
